import SysTray from 'systray'
import { updateStreamdecks, registerStreamdecks } from './streamdeck'
const open = require('open')

const systray = new SysTray({
  menu: {
    // you should using .png icon in macOS/Linux, but .ico format in windows, this is the logo encoded into base64
    icon: '',
    tooltip: 'Director Link',
    items: [
      {
        title: 'Configure DirectorLink',
        checked: false,
        enabled: true
      },
      {
        title: 'Refresh Devices',
        checked: false,
        enabled: true
      },
      {
        title: 'Quit DirectorLink',
        checked: false,
        enabled: true
      }
    ]
  },
  debug: false,
  copyDir: true
})

systray.onClick(action => {
  if (action.seq_id === 0) {
    open('http://localhost:3010')
  } else if (action.seq_id === 1) {
    registerStreamdecks().then(() => updateStreamdecks({ type: 'connected', force: true }))
  } else if (action.seq_id === 2) {
    updateStreamdecks({ type: 'shutdown' })
    setTimeout(() => {
      systray.kill()
    }, 500)
  }
})
